import React from 'react';
import Card from './Card';


const Cardlist = ({rollData}) => {
  if (true){
    throw new Error('Nooooo');
  }

     return(

		<div >
		{
		rollData.map((user, i) => {
      	return (  
      		<Card key={i} 
      		id={rollData[i].id} 
      		name={rollData[i].rolldata} 
      		email={rollData[i].rolldate}

            />

      	);

      })
     }
		 </div>
	);
}






export default Cardlist;
